value:
(
  statementItem: StatementItem
): string | undefined => {
  if (statementItem.tsFunction) {
    return tsFunctionToMarkdownString(statementItem.tsFunction);
  }

  if (statementItem.tsInterface) {
    return tsInterfaceToMarkdownString(statementItem.tsInterface);
  }

  if (statementItem.tsVariable) {
    return tsVariableToMarkdownString(statementItem.tsVariable);
  }
}
